    <div className="container mt-4">
      <Card className="col-md-5 mx-auto shadow" style={{ width: "60%" }}>
        <Card.Body>
          <Card.Title className="text-center ">Student Details</Card.Title>
          <div>
            <p><strong>Id : </strong>11</p>
            <p><strong>Name : </strong>23123</p>
            <p><strong>Email : </strong>23123</p>
            <p><strong>Phone : </strong>21312</p>
            <p><strong>Place : </strong>213</p>
          </div>
          
        </Card.Body>
      </Card>
    </div>
  );
}
